import React from "react";

function AllWishLists(props) {
  console.log("this is props  from AllWishLists", props);

  let things = props.propswishList.map((d, i) => {
    return (
      <li key={i} onClick={() => props.propsaddWishList(d)}>
        : {d.name}
        {/* - Check in :{d.checkIn} - Check Out:
        {d.checkOut} */}
      </li>
    );
  });

  return (
    <div>
      <h2>Your dream in progress....</h2>
      <ul>{things}</ul>
    </div>
  );
}

export default AllWishLists;
